window.bookSummaryJSON = "<p>Trixie is a feline of a unique sort. She's hustled the streets of the Big Easy many times but never quite like this. Trixie finds that when in New Orleans, hoodoo is much more than a tourist shop full of souvenirs. Reality has never been stranger and the stakes are much higher than ever before. See how this sexy feline takes on every challenge thrown at her and in the process discovers that there's more to life than meets the eye. </p> <p>This is a (short) story in an upcoming series by Karli Rush. </p>"; 
